import { useEffect, useState } from 'react';
import './App.css';

function App() {

  const [users, setUsers] = useState(['dgxdgx', 'sfsdfds'])

  useEffect(() => {
    fetch('http://127.0.0.1:8000/users/', {
      'method': 'GET',
      headers: {
        'Content-Type': 'application/json',
        'Authorization': 'Token e12876a2eb51aad4ae21f625b577e45970914967',
        'Access-Control-Allow-Origin': 'http://127.0.0.1:8000/users/'
      }
    })
    .then(resp => resp.json())
    .then(resp => setUsers(resp))
    .catch(error => console.log(error))
    }, []
  )

  return (
    <div className="App">
      <h3>dgfdfg</h3>
      {users.map(user => {
        return <h2>{user.email}</h2>
      })}
    </div>
  );
}

export default App;
